/*Table structure for table `user_table` */

DROP TABLE IF EXISTS `user_table`;

CREATE TABLE `user_table` (
  `user_id` varchar(10) NOT NULL,
  `branch_id` varchar(10) default NULL,
  `staff_service_id` varchar(10) default NULL,
  `firstname` varchar(15) default NULL,
  `lastname` varchar(15) default NULL,
  `u_password` varchar(10) default NULL,
  `user_type` varchar(15) default NULL,
  `initial_pass_changed` tinyint(1) default NULL,
  PRIMARY KEY  (`user_id`),
  KEY `FK_user_table` (`branch_id`),
  CONSTRAINT `user_table_ibfk_1` FOREIGN KEY (`branch_id`) REFERENCES `branch` (`branch_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

